public class Even_03{

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//ผภฺ 1~100
		for (int i=1; i<=100; i++) {
			//System.out.println(i);
			if(i%2==0) {
				System.out.println(i+"ดย ยฆผ๖");
			}else {
				System.out.println(i+"ดย ศฆผ๖");
			}
		}
	}
}
